import React, { PureComponent } from 'react';
import Pic from './Pic.js'
import styles from './pic.module.css'

export default class PicComponent extends PureComponent {
    render() {
        return (
            <div className={styles.biggerContainer+" "+this.props.style}>
               {this.props.values.map((item,i) => <Pic src={item.src}>{item.value}</Pic>)}
            </div>
        );
    }
}
